import ReactDOM from 'react-dom';
import App from './App';
import * as serviceWorker from './serviceWorker';
import MultiCount from './components/multiCount';
import NavBar from './components/NavBar';
import './index.css';
import './NavBar.css';
import 'bootstrap/dist/css/bootstrap.css';

